Over 8,700 Veteran-facing staff have left the VA across the country this year. That's unacceptable.
 
@SenJackReed, @SenWhitehouse, @Rep_Magaziner, and I are demanding answers on how the reduced VA workforce will affect Rhode Island’s Veterans.

https://t.co/Uw4cMC87MY

Trump’s war on science continues. 

@epaleezeldin is shutting down the @EPA research and development office, which protects Americans’ health and environment through sound, unbiased research.

I’m fighting back with @RepDeborahRoss by leading 88 of our colleagues in protecting @EPA research and demanding that this essential work continue.

Texas’ devastating flash floods are a wake up call — Trump’s cuts to @NWS and @fema could have harmful consequences.

@RepGregStanton and I are leading the charge to protect extreme weather forecasting, disaster coordination, and incident response to prevent harm to the American people.

Watch 📺

🚨Attention Rhode Islanders:🚨

@NWSBoston issued a flood watch and heat advisory for all of RI today. Please stay safe, avoid driving on flooded roads, and check on vulnerable neighborhoods.

Follow @RhodeIslandEMA and @NWSBoston for updates.

After severe storms ravaged regions of our country this week, the critical public safety role @NOAA and @NWS workers play in keeping America safe has never been more clear. 
 
@sciencedems have had enough of the reckless firings at NOAA and the National Weather Service. We introduced legislation to halt reductions in force at federal science agencies to keep Americans safe and end Trump’s chaos.
https://t.co/lqCDLDmP0f

We’re on the side of the American people.

While their reckless agenda is driving our economy into a ditch, Republicans would rather point fingers than actually do the work necessary to prevent a shutdown. 
 
@HouseDemocrats are ready to return to Washington to vote on a four-week bipartisan funding agreement to ensure a real negotiation.

In case you needed further proof of which side is which:

@HouseGOP = taking marching orders from the world’s wealthiest person

@HouseDemocrats = fighting to keep government open and pay our troops through the holidays
